import { Link } from "react-router-dom";
const NavBar = () => {
  return (
    <ul>
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/products">Sign in</Link>
      </li>
      <li>
        <Link to="/posts/2018/06">Sign up</Link>
      </li>
    </ul>
  );
};

export default NavBar;
